import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import MainPageOverview from './pages/MainPageOverview';
import Login from './pages/Login'; // Import the Login component
import Maps from './pages/Maps';
import Plans from './pages/Plans';
import Partners from './pages/Partners';
import UserDashboard from './pages/UserDashboard';
import BookNow from './pages/BookNow';
import { Layout, Menu } from 'antd';
import {
  HomeOutlined,
  GlobalOutlined,
  ProjectOutlined,
  UsergroupAddOutlined,
  DashboardOutlined,
  CalendarOutlined,
  LogoutOutlined,
} from '@ant-design/icons';

import schoolLogo from './assets/bus.png';

import './App.css'; // Import App.css file

const { Sider, Content } = Layout;
const { Item } = Menu;

function App() {
  const [collapsed, setCollapsed] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false); // Track user's login status

  // Function to handle logout
  const handleLogout = () => {
    setIsLoggedIn(false); // Update login status to false on logout
    // Redirect the user to the login page
    window.location.href = '/login';
  };

  // Function to handle login
  const handleLogin = async (values) => {
    try {
      // Make a POST request to your backend API
      const response = await axios.post('http://localhost:5000/api/login', values);
      if (response.data.success) {
        setIsLoggedIn(true); // Update login status to true on successful login
        // Redirect the user to the admin dashboard upon successful login
        window.location.href = '/admin/dashboard';
      } else {
        setErrorMessage(response.data.message); // Set error message if login is unsuccessful
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <Router>
      <Layout style={{ minHeight: '100vh'}}>
        <Sider collapsible collapsed={collapsed} onCollapse={setCollapsed} style={{ width: '100%' }}>
          <div className="logo">
            <img src={schoolLogo} alt="School Logo" style={{ width: '100%', height: 'auto' }} />
          </div>
          <Menu theme="dark" mode="inline" >
            <Item key="home" icon={<HomeOutlined />}>
              <Link to="/">Home</Link>
            </Item>
            <Item key="maps" icon={<GlobalOutlined />}>
              <Link to="/maps">Maps</Link>
            </Item>
            <Item key="plans" icon={<ProjectOutlined />}>
              <Link to="/plans">Plans</Link>
            </Item>
            <Item key="partners" icon={<UsergroupAddOutlined />}>
              <Link to="/partners">Partners</Link>
            </Item>
            {isLoggedIn ? (
              <>
                <Item key="user-dashboard" icon={<DashboardOutlined />}>
                  <Link to="/user-dashboard">User Dashboard</Link>
                </Item>
                <Item key="book-now" icon={<CalendarOutlined />}>
                  <Link to="/book-now">Book Now</Link>
                </Item>
                <Item key="logout" icon={<LogoutOutlined />} onClick={handleLogout}>
                  Logout
                </Item>
              </>
            ) : (
              <Item key="login" icon={<LogoutOutlined />}>
                <Link to="/login">Login</Link>
              </Item>
            )}
          </Menu>
        </Sider>
        <Layout>
          <Content className="content">
            <Routes>
              <Route exact path="/" element={<MainPageOverview />} />
              <Route exact path="/login" element={<Login onLogin={handleLogin} />} /> {/* Pass the handleLogin function to the Login component */}
              <Route exact path="/maps" element={<Maps />} />
              <Route exact path="/plans" element={<Plans />} />
              <Route exact path="/partners" element={<Partners />} />
              <Route exact path="/user-dashboard" element={<UserDashboard />} />
              <Route exact path="/book-now" element={<BookNow />} />
            </Routes>
          </Content>
        </Layout>
      </Layout>
    </Router>
  );
}

export default App;
